import React from 'react';

import '../App.css';

{/* Privacy page */}

function Privacy() {
    return (
        <div>
            <h1>Privacy Policy</h1>
            <div className="center">
                <div className="word">
            <p>We, at ToUpper LLC, understand the importance of privacy. When you use our application services, we try to make sure we give users the most up to date features. Some of these features may require to use some data. We use data to build better services and to make your life easier on a day to day basis. </p>
            </div>
            </div>
        </div>
    );
}

export default Privacy;
